import { Link } from 'react-router-dom';
import Header from '../components/header';
import aircallgif from '../assets/aircallgif.gif';
import Notch from '../components/notch';

const Phone = () => {
	return (
		<div className="absolute flex flex-col items-center justify-center left-0 top-0 right-0 bottom-0">
		<div className="w-96 h-3/5 z-100 bg-white rounded-md shadow-lg ">
		  <Notch />
		  <div className='w-full flex justify-center'>
		  <button className={'bg-app-green text-white mt-12 px-6 py-2 rounded-lg hover:shadow-xl hover:scale-105'}>
				Let's Get Started!
		  </button>
		  </div>
		</div>
	  </div>
	);
};

export default Phone;
